import React from 'react';

export default function SVGFog({ className }) {
  const width = typeof window !== 'undefined' ? window.innerWidth : 1920;
  const height = typeof window !== 'undefined' ? window.innerHeight : 1080;
  return (
    <svg
      className={className}
      width={width}
      height={height}
      viewBox={`0 0 ${width} ${height}`}
      fill="none"
      xmlns="http://www.w3.org/2000/svg"
      style={{ filter: 'blur(80px)', width: '100vw', height: '100vh', display: 'block' }}
    >
      <ellipse
        cx="0"
        cy={height}
        rx={width * 0.7}
        ry={height * 0.5}
        fill="#fff"
        fillOpacity="0.32"
      />
      <ellipse
        cx="0"
        cy={height}
        rx={width * 0.4}
        ry={height * 0.3}
        fill="#fff"
        fillOpacity="0.18"
      />
      <ellipse
        cx="0"
        cy={height}
        rx={width * 0.2}
        ry={height * 0.15}
        fill="#fff"
        fillOpacity="0.13"
      />
    </svg>
  );
}
